    false,nt"url": null,nt"notes": "Nonnative fish including tench, pumpkinseed
    sunfish, and yellow perch have either accidentally or intentionally introduced into
    McDowell lake. In conjunction with WA Department of Fish and Wildlife rotenone was
    applied to the closed system to remove all fish. Restoration of native fish species
    will occur in spring of 2015. Funding was transferred to the State of Washington
    Department of Fish and Wildlife which contributed $44220 in in supplies and payroll
    towards project. Funds were used for helicopter application contract and payroll
